import React from "react";

const floatingWords = [
  { word: "Front-end", bold: true },
  { word: "Backend", bold: true },
  { word: "UI/UX", bold: true },
  { word: "React" },
  { word: "Next.js" },
  { word: "JavaScript" },
  { word: "HTML" },
  { word: "CSS" },
  { word: "Python" },
  { word: "Design" },
  { word: "MongoDB" },
  { word: "Express" },
  { word: "TypeScript" },
  { word: "Animation" },
  { word: "Portfolio" },
];

function IntroFloatingWords() {
  return (
    <div className="floating-container">
      {floatingWords.map((item, index) => {
        const top = Math.floor(Math.random() * 80); // top: 0–80%
        const left = Math.floor(Math.random() * 90); // left: 0–90%

        return (
          <span
            key={index}
            className={`floating-word ${item.bold ? "bold" : ""}`}
            style={{
              top: `${top}%`,
              left: `${left}%`,
              animationDelay: `${index * 0.3}s`,
              animationDuration: `${6 + Math.random() * 5}s`,
            }}
          >
            {item.word}
          </span>
        );
      })}
    </div>
  );
}

export default IntroFloatingWords;
